props.description:
Propriedade utilizada para definir o modo de exibição do componente.

`single`: Apenas um input de tempo;

`range`: Dois inputs de tempo (início e fim).

Rota default para quando a prop showBackNavigation estiver habilitada
Deve seguir o seguinte formato: { name: 'route-name', path: 'route-path' }
Obs: não é necessário fornecer name e path, apenas um já é o suficiente

Um array com objetos com as propriedades 'title' (obrigatório), 'subtitle' e 'image'.
O 'title' e 'subtitle' são textos que descrevem a etapa, a 'imagem' é o caminho para
a imagem do empty-state;
